import java.io.Serializable;
import java.sql.Date;
import java.util.Objects;

public class VprojactId implements Serializable {

    private String projno;
    private Short actno;
    private Float acstaff;
    private Date acstdate;
    private Date acendate;

    public String getProjno() {
        return this.projno;
    }

    public void setProjno(String projno) {
        this.projno = projno;
    }

    public Short getActno() {
        return this.actno;
    }

    public void setActno(Short actno) {
        this.actno = actno;
    }

    public Float getAcstaff() {
        return this.acstaff;
    }

    public void setAcstaff(Float acstaff) {
        this.acstaff = acstaff;
    }

    public Date getAcstdate() {
        return this.acstdate;
    }

    public void setAcstdate(Date acstdate) {
        this.acstdate = acstdate;
    }

    public Date getAcendate() {
        return this.acendate;
    }

    public void setAcendate(Date acendate) {
        this.acendate = acendate;
    }

    @Override
    public boolean equals(Object o) {
        if (this == o) return true;
        if (!(o instanceof Vprojact)) return false;
        final Vprojact vprojact = (Vprojact) o;
        return Objects.equals(getProjno(), vprojact.getProjno()) &&
                Objects.equals(getActno(), vprojact.getActno()) &&
                Objects.equals(getAcstaff(), vprojact.getAcstaff()) &&
                Objects.equals(getAcstdate(), vprojact.getAcstdate()) &&
                Objects.equals(getAcendate(), vprojact.getAcendate());
    }

    @Override
    public int hashCode() {
        return Objects.hash(getProjno(),
                getActno(),
                getAcstaff(),
                getAcstdate(),
                getAcendate());
    }
}
